  "Allegations" : "ARTICLE V, SECTION 2(C) OF THE FINRA BY-LAWS, FINRA RULES 1122, 2010, 8210, NASD RULE 3040, INTERPRETATIVE MATERIAL 1000-1 - TIMOTHY MORAN INTRODUCED FIRM CUSTOMERS TO A PRIVATE HEDGE FUND TO DISCUSS POSSIBLE INVESTMENT IN THE HEDGE FUND. MORAN RECOMMENDED THAT THE CUSTOMERS INVEST, OR CONSIDER INVESTING, IN THE HEDGE FUND, OR PARTICIPATED IN MEETINGS, PHONE CONVERSATIONS OR OTHER COMMUNICATIONS BETWEEN HIS CUSTOMERS AND THE HEDGE FUND'S OWNER. CUSTOMERS INVESTED APPROXIMATELY $1.69 MILLION IN THE HEDGE FUND. MORAN PERSONALLY INVESTED A TOTAL OF $150,000 IN THE FUND. MORAN RECEIVED MORE THAN $200,000 AS COMPENSATION FOR HIS ASSISTANCE IN OBTAINING INVESTMENTS. MORAN DID NOT DISCLOSE HIS INVOLVEMENT OR PARTICIPATION IN SELLING INTERESTS IN THE HEDGE FUND TO HIS MEMBER FIRM OR OBTAIN THE FIRM'S PERMISSION TO DO SO. MORAN FAILED TO RESPOND TO FINRA REQUESTS FOR DOCUMENTS AND INFORMATION AND FALSELY RESPONDED TO A FINRA REQUEST FOR INFORMATION. MORAN FAILED TO TIMELY AMEND HIS FORM U4 TO DISCLOSE A $216,654 IRS LIEN FOR UNPAID TAX LIABILITIES.",
  "Resolution" : "Decision",
